The gentle, popular Satoshi goes drinking one night with co-workers from his previous job. There, Satoshi meets Tatsuo, an unabashed lover of sex who quickly becomes attached to him. Although he looks rough, Tatsuo acts spoiled, so Satoshi starts to find him cute!

&quot;Tatsuo, do you like me?&quot; &quot;A lot.&quot;

Nowadays, delinquents are weak when it comes to attractive men!

&quot;Il y a dix ans vous m'avez laiss&eacute;e tomber parce que j'&eacute;tais une fille, aujourd'hui, qui peut gagner contre moi ?!&quot;
Yun Ruiwen va montrer au monde que le Go professionnel n'est pas qu'un monde d'hommes.

&quot;Ten years ago, you abandoned me because I was a girl, but now, which one of you can win against me?!&quot;

The lingering love of her past life has turned into a demon that will hate her until death. 

The Qingcheng of this life is certain that the past life that killed her was stained in blood... A tale of the strings of love and hate connecting three people, one that has spanned over two lives and two deaths. Love and hate are so hard to understand...

&quot;If I had the choice, I would never have met you again.&quot;

&quot;My father also said that as long as you live, there is hope.
But then if we come to die ... &quot;

Luna is optimistic despite her difficult student's life . Until she falls from the roof of her university. She wakes up then in a strange and hostile place where the only solution to get out of it seems to be to die repeatedly. Why is she here? and what does the entity named Y want, whose messages drive her to accept this cycle?

