&ldquo;I&rsquo;ll be your slave.&rdquo;
Lonely high school student Youhei doesn&rsquo;t belong to anywhere, be it his home or his school. That time, he ran into Ryou, a classmate who is also an ace in soccer club. The two were gradually drawn to each other, but&hellip; After an accident, their relationship was changed significantly. That was the beginning of a distorted pure love that would last for several years later&hellip;
&ldquo;I&rsquo;ll do housework, I&rsquo;ll drop you off, pick you up. I&rsquo;ll have sex with you. I&rsquo;ll do anything Ryou wants. Everything, as long as I can be with Ryou.&rdquo;
The debut work of story teller Nishimoto Rou.
